function Dia() {
    return (
        <div className="flex justify-center gap-4 p-4">
            <img 
                src="/assets/rouge_comparison[1].png" 
                alt="Rouge Comparison" 
                className="w-1/4 h-auto rounded-lg shadow-md"
            />
            <img 
                src="/assets/fig2.png" 
                alt="Figure 2" 
                className="w-1/4 h-auto rounded-lg shadow-md"
            />
        </div>
    );
}

export default Dia;
